import React, { useEffect, useState } from 'react';
import { apiUrl, axiosInstance, generateRefreshToken } from '../axios';

export default function AllUsers() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    getUser();
  }, []);

  // LIST
  const getUser = async () => {
    await axiosInstance
      .get(apiUrl + '/medical_store_app/user')
      .then((response) => {
        if (response.status === 200) {
          // Filter users where auth_user is false
          // const filteredUsers = response.data.filter(user => user.auth_user === false);
          // setUsers(filteredUsers);
        }
      })
      .catch((error) => {
        if (error.response?.status === 401) {
          generateRefreshToken(error);
        }
      });
  };

  // Inline styles
  const containerStyle = {
    margin: '40px auto',
    padding: '20px',
    maxWidth: '1000px',
    backgroundColor: '#f8f9fa',
    borderRadius: '10px',
    boxShadow: '0px 0px 15px rgba(0, 0, 0, 0.1)'
  };

  const headingStyle = {
    textAlign: 'center',
    marginBottom: '20px',
    color: '#343a40'
  };

  const tableStyle = {
    width: '100%',
    marginTop: '20px'
  };

  const theadStyle = {
    backgroundColor: '#343a40',
    color: 'white'
  };

  const rowStyle = {
    textAlign: 'left'
  };

  return (
    <div>
      <div className="row m-3">
        <h1 style={headingStyle}>All Users</h1>
      </div>
      <div style={containerStyle}>
        <div>
          <table style={tableStyle} className="table table-striped">
            <thead style={theadStyle}>
              <tr>
                <th style={rowStyle}>SL No</th>
                <th style={rowStyle}>Name</th>
                <th style={rowStyle}>Last Name</th>
                <th style={rowStyle}>Username</th>
                <th style={rowStyle}>Email</th>
                <th style={rowStyle}>Registered On</th>
              </tr>
            </thead>
            <tbody>
              {users.map((user, i) => (
                <tr key={`user_rows${i}`}>
                  <td>{i + 1}</td>
                  <td>{user.first_name}</td>
                  <td>{user.last_name}</td>
                  <td>{user.username}</td>
                  <td>{user.email}</td>
                  <td>{user.date_joined?.split('T')[0]}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}
